import { Component, OnInit } from '@angular/core';
import { map } from 'rxjs';
import { UserExpense } from 'src/app/models/Userexpense';
import { UserexpenceService } from 'src/app/services/userexpence.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit {

  constructor(private readonly userExpenceService: UserexpenceService) { }
  userExpenses: Array<UserExpense> = []

  async GetListOfUserExpenses(){
    return await this.userExpenceService.GetListOfUserExpenses()
    .pipe(
      map((result: any) => {
        return result;
      }) 
    ).subscribe((response) => {
      this.userExpenses.push(response);
      console.log(this.userExpenses);
    })
  }

  ngOnInit(): void {
    this.GetListOfUserExpenses()
  }

}
<div>
    <tr *ngFor="let item of userExpenses">
        <td>{{item.members}}</td>
    </tr>
</div>
